import React, { useState, useRef } from 'react';
import { GoogleMap, LoadScript, Marker } from '@react-google-maps/api';
import axios from 'axios';
import './Styles/LoadMap.css';

function LoadMap() {
  const containerStyle = {
    width: '100%',
    height: '650px'
  };

  const defaultCentre = {
    lat: 51.5074456,
    lng: -0.1277653
  };

  const [location, setLocation] = useState('');
  const [mapMarkers, setMapMarkers] = useState([]);
  const [selectedMapMarkers, setSelectedMapMarkers] = useState(null);
  const [PopupBox, setPopupBox] = useState(false);
  const [centre, setCentre] = useState(defaultCentre);
  const mapRef = useRef(null);

  const newLocation = (e) => {
    setLocation(e.target.value);
  };

  const fetchFoursquareData = async (lat, lng) => {
    const clientId = 'YOUR_FOURSQUARE_CLIENT_ID';
    const clientSecret = 'YOUR_FOURSQUARE_CLIENT_SECRET';
    const apiUrl = `https://api.foursquare.com/v2/venues/explore?ll=${lat},${lng}&radius=1000&query=wheelchair&client_id=${clientId}&client_secret=${clientSecret}&v=20230503`;

    try {
      const response = await axios.get(apiUrl);
      const venues = response.data.response.groups[0].items;

      const markers = venues.map((venue) => ({
        lat: venue.venue.location.lat,
        lng: venue.venue.location.lng,
        name: venue.venue.name,
        address: venue.venue.location.address,
        accessibility: venue.venue.attributes
          ? venue.venue.attributes.groups
              .find((group) => group.name === 'General')
              ?.items.some((item) => item.text === 'Wheelchair accessible')
          : false
      }));

      setMapMarkers(markers);
    } catch (error) {
      console.error('Error fetching Foursquare data:', error);
    }
  };

  const submitForm = async (e) => {
    e.preventDefault();

    const geocoder = new window.google.maps.Geocoder();
    geocoder.geocode({ address: location }, (results, status) => {
      if (status === 'OK' && results.length > 0) {
        const coords = results[0].geometry.location;
        setCentre({ lat: coords.lat(), lng: coords.lng() });
        fetchFoursquareData(coords.lat(), coords.lng());
      } else {
        alert('Location not found.');
      }
    });
  };

  const addToItinerary = async (placeName) => {
    try {
      const response = await axios.post("http://127.0.0.1:8000/addToItinerary/", { name: placeName });
      alert(response.data.message || "Added to itinerary");
    } catch (error) {
      console.error(error);
      alert("We were unable to add attraction");
    }
  };

  return (
    <div className="container">
      <h1>Find Wheelchair Accessible Activities</h1>
      <form onSubmit={submitForm}>
        <div className="location">
          <label>Location:</label>
          <input
            type="text"
            placeholder="Enter your Location"
            value={location}
            onChange={newLocation}
            required
          />
          <button className="submit-button" type="submit">Search</button>
        </div>
      </form>

      <LoadScript
        googleMapsApiKey={process.env.REACT_APP_GOOGLE_MAPS_API_KEY}
        libraries={['places']}
      >
        <GoogleMap
          mapContainerStyle={containerStyle}
          center={centre}
          zoom={10}
          onLoad={map => (mapRef.current = map)}
        >
          {mapMarkers.map((marker, index) => (
            <Marker
              key={index}
              position={{ lat: marker.lat, lng: marker.lng }}
              onClick={() => {
                setSelectedMapMarkers(marker);
                setPopupBox(true);
              }}
            />
          ))}
        </GoogleMap>
      </LoadScript>

      {PopupBox && selectedMapMarkers && (
        <div className="modal-backdrop" onClick={() => setPopupBox(false)}>
          <div className="modal-box" onClick={e => e.stopPropagation()}>
            <h2>{selectedMapMarkers.name}</h2>
            <p><strong>Address:</strong> {selectedMapMarkers.address}</p>
            <p><strong>Wheelchair Access:</strong> {selectedMapMarkers.accessibility ? 'Yes' : 'No'}</p>
            <button onClick={() => addToItinerary(selectedMapMarkers.name)}>Add to Itinerary</button>
            <button onClick={() => setPopupBox(false)}>Close</button>
          </div>
        </div>
      )}
    </div>
  );
}

export default LoadMap;
